INSERT INTO product (barcode_id, product_name, ingredients, product_image, fat_amount, saturated_fats, carbohydrate, sugar, dietary_fiber, protein, salt, sodium, alcohol, is_healthy)
VALUES ('3350033276260', 'Salade de Tomates Cerise, Lentilles et Basilic', 'INFORA NUTR MOYE Lentilles cuites 38% ( eau , lentilles corail 9,6%, lentilles vertes 9,6%-tomates cerise 23% - huile d\'arachide - feta aux herbes aromatiques (feta, herbes aromatiques) - basilic 5.9%-roquette - huile d\'olive vierge extra - blanc d\'ceuf (blanc d\'ceuf, épaississant : gomme guar) - échalote - vinaigre de vin blenc (eau, vinaigre de vin blanc, conservateur : sulfite acide de patassium) préparation déshydratée [sel, extraits de levure, a nidon transformé de pommes de terre, légumes (dont céleri-rave), maltodextrine, huile d\'olive vierge extra, sucre, extrait de graines de céleri et de légumes, épices et aromates, arômes naturels (dont céleri), jus de citron concentré] - sel - poivre-épaississant : gomme xanthane. Fabriqué dans un atelier qui utilise du gluten. Les informations en gras sont destinées aux personnes intolérantes ou allergiques. Ene dont', 'https://static.openfoodfacts.org/images/products/335/003/327/6260/front_fr.4.400.jpg', '16', '2.7', '8.4', '1.6', '5', '6.3', '0.7', '0.275590551181102', '', '1');

INSERT INTO product (barcode_id, product_name, ingredients, product_image, fat_amount, saturated_fats, carbohydrate, sugar, dietary_fiber, protein, salt, sodium, alcohol, is_healthy)
VALUES ('3350033276307', 'Orzo au Basilic, Petits Légumes Fromage Frais', 'Pâtes &quot;orzo&quot; cuites 41% (eau, semoule de _blé_ dur) - _fromage_ ricotta 11% (_lactosérum_ correcteurs d\'acidité acide citrique et acide lactique) - _fromage_ frais 8.6% (_fromage_ frais, sel) - tomate 7.2% - tomate cerise 7% - courgette 6.2% - huile de colza - poivron rouge grillé 2.3% - poivron jaune grillé 2.3% - _crème_ (_crème_ stabilisant carraghénanes) - basilic 2% - huile d\'olive vierge extra - jus de citron à base de concentré (eau, jus de citron concentré, antioxydants : acide ascorbique et anhydre sulfureux) - persil - sel - échalote - _fromage_ Parmigiano Reggiano - ail - _moutarde_ de Dijon (eau, graines de _moutarde_, vinaigre, sel, conservateur :  _sulfite_, acide de sodium)) - ciboulette - menthe - poivre blanc - origan - sucre - piment d\'Espelette - amidon transformé de tapioca - épaississants: alginate de sodium et gomme xanthane', 'https://static.openfoodfacts.org/images/products/335/003/327/6307/front_fr.13.400.jpg', '7.2', '3', '16', '2.6', '', '4.7', '0.67', '0.263779527559055', '', '1');

